import React from 'react';
const initGame = (props) => {
    let initPlayers = null;
    for (let i = 0; i < props.count; i++) {
        initPlayers = (
            <label htmlFor="">Player {i+1}'s name:<input type="text"/></label>
        )
    }
    return (
        <div className={classes.player}>
            {initPlayers}
        </div>
    )
}

export default initGame;
